import './App.scss';
import resumeData from "./assets/resume.json"
import parse from 'html-react-parser';

function App() {
  return (
    <div className="App">
      {parse(resumeData.content), {
        replace: domNode => {
          if (domNode) {
            return {domNode}
          }
        }
      }}
    </div>
  );
}

export default App;
